            position: relative;
            background: url("/splash.jpg") no-repeat center center fixed;
            height: 90vh;
          }
          .overlay {
            width: 100%:
            height: 100%:
            background-color: rgba(0,0,0,0.3);
            position: absolute;

          }
        `}</style>
      </div>
    </Layout>
  );
}
